description:
Verenigd Koninkrijk
Drama
129 minuten

geregisseerd door Joe Wright
met Keira Knightley, Jude Law en Aaron Johnson

Het verhaal speelt zich af in de high society van het 19e-eeuwse Rusland, en verkent de mogelijkheid tot liefde die door het menselijk hart stroomt, van de passie tussen twee mensen die overspel plegen tot de band tussen een moeder en haar kinderen. Wanneer Anna Karenina (Knightley) haar geluk met haar man Alexei (Law) in vraag stelt en hopeloos verliefd wordt op de jonge graaf Vronski (Johnson), zal dit grote veranderingen teweegbrengen in haar familie, vriendenkring en de gemeenschap.


